B.VF=new A.aw("Ya. Proses registrasi akun di DigitalVoucherIndonesia sangat mudah dan gratis. Detail akun Anda akan disimpan untuk memudahkan transaksi Anda selanjutnya di DigitalVoucherIndonesia. Apabila Anda sedang bertransaksi namun belum sempat daftar akun, Anda bisa langsung memasukkan alamat email di kolom yang tersedia. Secara otomatis alamat email Anda akan terdaftar menjadi akun di DigitalVoucherIndonesia dan Anda akan dikirimi email notifikasi. Kemudian, selesaikan transaksi yang sedang dilakukan.",null,B.u,null,null,null,null,null,null)
