B.Uw=new A.aw("Apabila melalui desktop, registrasi bisa langsung dilakukan dengan mengeklik menu 'Sign Up' pada pojok kanan situs. Masukkan nama, nomor ponsel, alamat email, dan password, lalu klik 'Daftar'.",null,B.u,null,null,null,null,null,null)
B.V6=new A.aw("Apabila melalui aplikasi, download aplikasi DigitalVoucherIndonesia terlebih dulu, kemudian buka aplikasi dan pilih menu 'Register'. Masukkan nama, nomor ponsel, alamat email, dan password, lalu klik 'Register'.",null,B.u,null,null,null,null,null,null)
B.Va=new A.aw("Anda telah selesai melakukan registrasi dan email konfirmasi akan langsung dikirimkan ke alamat email yang didaftarkan.",null,B.u,null,null,null,null,null,null)
B.VB=new A.aw("Saya lupa dengan password akun DigitalVoucherIndonesia saya. Bagaimana cara agar saya bisa mendapat password saya kembali?",null,B.u,null,null,null,null,null,null)
B.Vy=new A.aw("Pada situs atau aplikasi DigitalVoucherIndonesia, pilih menu 'Sign In', kemudian pilih opsi 'Lupa Password Masuk ke DigitalVoucherIndonesia?' yang ada di bagian bawah kotak Sign In. Kemudian, Anda perlu memasukkan alamat email yang Anda gunakan saat registrasi. Anda akan dikirimi email konfirmasi untuk mereset atau mengatur ulang password akun DigitalVoucherIndonesia Anda. Masukkan password atau kata sandi baru yang Anda inginkan, kemudian klik 'Ubah Kata Sandi'.",null,B.u,null,null,null,null,null,null)
B.VM=new A.aw("Bagaimana cara mengganti password akun DigitalVoucherIndonesia saya?",null,B.u,null,null,null,null,null,null)
